workflows:
  manual-provisioning:
    name: Manual Provisioning
    environment:
      vars:
        CM_CERTIFICATE: Encrypted()
        CM_CERTIFICATE_PASSWORD: Encrypted(Z0FBQUFBQmVEMVVzalltWXNBY3NUREs4Y0laSFNNNGdBeFo2UDE1UzVSZ0lXSXJRRWxFNnNfVUpJVE90MXozMmMzeXEwSDBCUGlYUlZZb3B0ZkxVdjNwTmlNUXdXTUFpc0E9PQ==)
        CM_PROVISIONING_PROFILE: Encrypted()
      flutter: stable
    scripts:
      - sudo python3 -m pip install https://github.com/codemagic-ci-cd/cli-tools/archive/feature/automatic-provisioning.zip
      - flutter packages pub get
      - find . -name "Podfile" -execdir pod install \;
      - keychain initialize
      - |
        # set up provisioning profiles
        PROFILES_HOME="$HOME/Library/MobileDevice/Provisioning Profiles"
        mkdir -p "$PROFILES_HOME"
        PROFILE_PATH="$(mktemp "$PROFILES_HOME"/$(uuidgen).mobileprovision)"
        echo ${CM_PROVISIONING_PROFILE_1} | base64 --decode > $PROFILE_PATH
        echo "Saved provisioning profile $PROFILE_PATH"
      - |
        # set up signing certificate
        echo $CM_CERTIFICATE | base64 --decode > /tmp/certificate.p12
        keychain add-certificates --certificate /tmp/certificate.p12 --certificate-password $CM_CERTIFICATE_PASSWORD
      - flutter build ios --release --no-codesign
      - xcode-project use-profiles
      - xcode-project build-ipa --workspace ios/Runner.xcworkspace --config Release
    artifacts:
      - build/ios/ipa/*.ipa
      - /tmp/xcodebuild.log
      - /tmp/codemagic-*.log
  automatic-provisioning:
