        APP_STORE_CONNECT_KEY_IDENTIFIER: Encrypted(Z0FBQUFBQmVGSjYwUFhLV2tISlZUdmIzMFBkS2Y0UEI5UkJMSUppUjBDTlMwSm9nVGhXN1JkMzJRUV9OUnJnMmZmV3VBLXg2czdKSEwtS0psUmhGem9vNWZkbmdkZjJDcGc9PQ==)
        APP_STORE_CONNECT_PRIVATE_KEY: Encrypted()
      flutter: stable
    scripts:
      - sudo python3 -m pip install https://github.com/codemagic-ci-cd/cli-tools/archive/feature/automatic-provisioning.zip
      - flutter packages pub get
      - find . -name "Podfile" -execdir pod install \;
      - keychain initialize
      - app-store-connect fetch-signing-files "$(xcode-project detect-bundle-id)" --type IOS_APP_DEVELOPMENT --create
      - keychain add-certificates
